import React, { useState } from 'react';

function Packages() {
  const [selectedPackage, setSelectedPackage] = useState(null);
  const [paymentStep, setPaymentStep] = useState(1);

  const handlePackageSelection = (selectedPackage) => {
    setSelectedPackage(selectedPackage);
  };

  const handleNext = () => {
    setPaymentStep(2);
  };

  const handlePaymentProceed = () => {
    // Logic to proceed with payment
  };

  const handlePaymentClose = () => {
    setSelectedPackage(null);
    setPaymentStep(1);
  };

  return (
    <div className="bg-white min-h-screen">
      <section>
        <div className="container mx-auto ">
          <div className="grid grid-cols-2 gap-8">
            <div className="container mx-auto p-9 max-w-sm bg-blue-600 rounded-2xl">
              {/* <img className="rounded-xl" src={basicImg} alt="" /> */}
              <p className="mt-2 text-white">
                This typically offers access to basic gym equipment and facilities, such as cardio machines, weights, and showers.
              </p>
              <div className="flex justify-between items-center">
                <div>
                  <h1 className="mt-5 text-2xl font-semibold text-white">Basic</h1>
                  <p className="mt-2">LKR 750.00</p>
                </div>
                <div>
                  <button
                    className="text-white text-md font-semibold bg-green-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110"
                    onClick={() => handlePackageSelection('Basic')}
                  >
                    Buy Now
                  </button>
                </div>
              </div>
            </div>

            {/* Repeat the above container code for other packages */}
            
            <div className="container mx-auto p-9 max-w-sm bg-blue-600 rounded-2xl">
              {/* <img className="rounded-xl" src={proImg} alt="" /> */}
              <p className="mt-2 text-white">
                This usually includes additional perks, such as access to group fitness classes, personal training sessions, and spa facilities.
              </p>
              <div className="flex justify-between items-center">
                <div>
                  <h1 className="mt-5 text-2xl font-semibold text-white">Premium</h1>
                  <p className="mt-2">LKR 1900.00</p>
                </div>
                <div>
                  <button
                    className="text-white text-md font-semibold bg-green-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110"
                    onClick={() => handlePackageSelection('Premium')}
                  >
                    Buy Now
                  </button>
                </div>
              </div>
            </div>

            <div className="container mx-auto p-9 max-w-sm bg-blue-600 rounded-2xl">
              {/* <img className="rounded-xl" src={familyImg} alt="" /> */}
              <p className="mt-2 text-white">
                This package is often designed for families and may include discounts or free access for multiple family members.
              </p>
              <div className="flex justify-between items-center">
                <div>
                  <h1 className="mt-5 text-2xl font-semibold text-white">Family</h1>
                  <p className="mt-2">LKR 2500.00</p>
                </div>
                <div>
                  <button
                    className="text-white text-md font-semibold bg-green-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110"
                    onClick={() => handlePackageSelection('Family')}
                  >
                    Buy Now
                  </button>
                </div>
              </div>
            </div>

            <div className="container mx-auto p-9 max-w-sm bg-blue-600 rounded-2xl">
              {/* <img className="rounded-xl" src={studentImg} alt="" /> */}
              <p className="mt-2 text-white">
                This typically offers access to basic gym equipment and facilities, such as cardio machines, weights, and showers.
              </p>
              <div className="flex justify-between items-center">
                <div>
                  <h1 className="mt-5 text-2xl font-semibold text-white">Student</h1>
                  <p className="mt-2">LKR 500.00</p>
                </div>
                <div>
                  <button
                    className="text-white text-md font-semibold bg-green-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110"
                    onClick={() => handlePackageSelection('Student')}
                  >
                    Buy Now
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {selectedPackage && (
        <div className="fixed top-0 left-0 w-full h-full flex justify-center items-center bg-black bg-opacity-50">
          <div className="container mx-auto p-9 max-w-sm rounded-2xl overflow-hidden shadow-xl">
            <h1 className="text-2xl font-semibold mb-4">{selectedPackage}</h1>

            {paymentStep === 1 && (
              <>
                <p className="text-gray-700 mb-4">Amount: LKR 750.00</p>
                {/* Additional fields for package selection */}
                <button
                  className="text-white text-md font-semibold bg-green-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110 mr-2"
                  onClick={handleNext}
                >
                  Next
                </button>
                <button
                  className="text-white text-md font-semibold bg-red-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110"
                  onClick={handlePaymentClose}
                >
                  Close
                </button>
              </>
            )}

            {paymentStep === 2 && (
              <>
                <p className="text-gray-700 mb-4">Additional fields for payment processing</p>
                {/* Additional fields for payment processing */}
                <button
                  className="text-white text-md font-semibold bg-green-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110 mr-2"
                  onClick={handlePaymentProceed}
                >
                  Proceed to Payment
                </button>
                <button
                  className="text-white text-md font-semibold bg-red-400 py-2 px-4 rounded-lg shadow-md hover:shadow-lg transition duration-500 transform-gpu hover:scale-110"
                  onClick={handlePaymentClose}
                >
                  Close
                </button>
              </>
            )}
          </div>
        </div>
      )}
    </div>
  );
}

export default Packages;
